var expect=require("expect.js"),$=require("../"),food=require("./fixtures").food;describe("utility methods",function(){describe(".contains",function(){it("(container, contained) : should correctly detect the provided element",function(){var e=$(food),t=e.find("#fruits"),n=t.find(".apple");expect($.contains(e[0],t[0])).to.equal(!0);expect($.contains(e[0],n[0])).to.equal(!0)});it("(container, other) : should not detect elements that are not contained",function(){var e=$(food),t=e.find("#fruits"),n=e.find("#vegetables"),r=t.find(".apple");expect($.contains(n[0],r[0])).to.equal(!1);expect($.contains(t[0],n[0])).to.equal(!1);expect($.contains(n[0],t[0])).to.equal(!1);expect($.contains(t[0],t[0])).to.equal(!1);expect($.contains(n[0],n[0])).to.equal(!1)})})});